import React from 'react';

class Todolist extends React.Component {
    render() {
        return (
            <ul>
                {this.props.items.map(item => (
                <li key={item.id}>
                {item.text}
                <button>Complete</button>
                <button>Update</button>
                <button>X</button>
                </li>                
                ))}
            </ul>
        );
    }
}

export default Todolist;
